def lastname(name):
    name = name.split()
    return name[1]

def sort_reindeer(reindeer_names):
    reindeer_names.sort(key=lastname)
    return reindeer_names

def sort_reindeer(reindeer_names):
    reindeer_names.sort(key = lambda x: x.split()[-1])
    return reindeer_names

def sort_reindeer(reindeer_names):
    with_last_names = []
    for i in reindeer_names:
        with_last_names.append((i, i.split(' ')[1]))
    return [i[0] for i in sorted(with_last_names, key = lambda x: x[1])]

def sort_reindeer(reindeer_names):
    sorted_list = []
    for name in reindeer_names:
        sorted_list.append(name.split())
    sorted_list = sorted(sorted_list, key=lambda names: names[1])

    result = []

    for item in sorted_list:
        name = item[0] + ' ' + item[1]
        result.append(name)

    return result
